import React from 'react'
import styled from 'styled-components';

const CardActivities = ({key, id, name, season, duration, dificult, created}) => {
  return (
    <ActivityContainer key={key}>
      <h1>Actividad: {name} [{id}]</h1>
      <h2>{season}</h2>
      <p>{duration}</p>
      <p>{dificult}</p>
      <p>{created}</p>

    </ActivityContainer>
  )
}

export default CardActivities;


const ActivityContainer = styled.section`
  display: flex;
  border: 1px solid black;
  flex-direction: column;
  text-align: center;

`
